function dataURItoBlob(dataURI) {
    // convert base64 to raw binary data held in a string
    var byteString = atob(dataURI.split(',')[1]);

    // separate out the mime component
    var mimeString = dataURI.split(',')[0].split(':')[1].split(';')[0];

    // write the bytes of the string to an ArrayBuffer
    var arrayBuffer = new ArrayBuffer(byteString.length);
    var _ia = new Uint8Array(arrayBuffer);
    for (var i = 0; i < byteString.length; i++) {
        _ia[i] = byteString.charCodeAt(i);
    }

    var dataView = new DataView(arrayBuffer);
    var blob = new Blob([dataView], { type: mimeString });
    return blob;
}

function rebuildPandoraTitle(title) {
	var newTitle = title.toLowerCase().split('*').join('').split('retired').join('')
	var temp = ''
	var temp2 = ''
	if (getRandomInt(0, 1) === 0) {
		temp = 'Authentic Pandora Gift '
		temp2 = 'Authentic Pandora Charm Bead Gift '
	} else {
		temp = 'Authentic Gift Pandora '
		temp2 = 'Authentic Gift Pandora Charm Bead '
	}
	if (newTitle.includes('bracelet') === true){
		newTitle = newTitle.split('pandora').join('').split('authentic').join('').split('bracelet').join('')
		if (newTitle.includes('100% 925 sterling silver') === true) {
			newTitle = newTitle.split('100% 925 sterling silver').join('')
			newTitle = temp +  'Bracelet 925 Sterling Silver ' + newTitle
		} else {
			newTitle = temp +  'Bracelet ' + newTitle
		}
	} else if (newTitle.includes('charm') === true) {
		newTitle = newTitle.split('charms').join('').split('charm').join('').split('pandora').join('').split('authentic').join('').split('beads').join('').split('bead').join('')
		if (newTitle.includes('100% 925 sterling silver') === true) {
			newTitle = newTitle.split('100% 925 sterling silver').join('')
			newTitle = temp2 + '925 Sterling Silver ' + newTitle
		} else {
			newTitle = temp2 + newTitle
		}
	} else {
		newTitle = newTitle.split('pandora').join('').split('authentic').join('').split('bracelet').join('')
		if (newTitle.includes('100% 925 sterling silver') === true) {
			newTitle = newTitle.split('100% 925 sterling silver').join('')
			newTitle = temp2 +  '925 Sterling Silver ' + newTitle
		} else {
			newTitle = temp2 + newTitle
		}
	}
	newTitle = newTitle.replace( /[\s\n\r]+/g, ' ' ).trim()
	if (newTitle.length > 80) {
		newTitle = newTitle.substr(0, 80)
	}
	if (isUpperCaseTitle) {
		newTitle = newTitle.toUpperCase()
	} else {
		newTitle = firstLetterToUpper(newTitle.toLowerCase())
	}
	return newTitle
}

function firstLetterToUpper(str)
{
	var t = str.split(' ')
	var newStr = ''
	for (i = 0; i < t.length; i++) {
		newStr += jsUcfirst(t[i]) + ' '
	}
	return newStr.trim()
}

