function clickApplyButton(applyButton) {
    var btnPos = applyButton.getBoundingClientRect();
    var event = new MouseEvent('mousedown', {
        'view': window,
        'bubbles': true,
        'cancelable': true,
        'screenX': btnPos.left,
        'screenY': btnPos.top
    });
    var event2 = new MouseEvent('mouseup', {
        'view': window,
        'bubbles': true,
        'cancelable': true,
        'screenX': btnPos.left,
        'screenY': btnPos.top
    });
    applyButton.dispatchEvent(event);
    applyButton.dispatchEvent(event2);
}

function getRandomSKU() {
    var sku = ""
    sku += makeid() + makeid() + "_";
    for (i = 0; i < 10; i++) {
        sku += getRandomInt(0, 9).toString();
    }
    return sku;
}

function getRandomTrackingNumber() {
    var tracking = "LP";
    for (var i = 0; i < 10; i++) {
        tracking += getRandomInt(0, 9).toString();
    }
    tracking += makeid();
    return tracking;
}

function getRandomInt(min, max) {
    return Math.floor(Math.random() * (max - min + 1)) + min;
}

function makeid() {
    var text = "";
    var possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";

    for (var i = 0; i < 2; i++)
        text += possible.charAt(Math.floor(Math.random() * possible.length));

    return text;
}


