function toHex(s) {
    // utf8 to latin1
    var s = unescape(encodeURIComponent(s))
    var h = ''
    for (var i = 0; i < s.length; i++) {
        h += "%" + s.charCodeAt(i).toString(16).toUpperCase()
    }
    return h
}

function isAlphaNumeric(code) {
  console.log(code);
    if (!(code > 47 && code < 58) && // numeric (0-9)
        !(code > 64 && code < 91) && // upper alpha (A-Z)
        !(code > 96 && code < 123)) { // lower alpha (a-z)
      return false;
    }
    return true;
}

function isContainSeedWord(w) {
    var hasNumber = /\d/;
    if (hasNumber.test(w) || w.toLowerCase().includes("seed") || w.toLowerCase().includes("seeds") || w.toLowerCase().includes("pcs") || w.toLowerCase().includes("pack") ||
            w.toLowerCase().includes("packs") || w.toLowerCase().includes("bag") || w.toLowerCase().includes("/") || w.toLowerCase().includes("rare")) {
        return true;
    }
    return false;
}

