function spinTheTitle(title) {
	var titleCharSet = title.split(" ");
	// remove space
	for (i = 0; i < titleCharSet.length; i++) {
		if (titleCharSet[i] === '') {
			titleCharSet.splice(i, 1)
			i = 0
		}
	}
    var numSwap = 0
    var numTry = 0
    var hasNumber = /\d/
    while (numSwap < 2) {
        if (titleCharSet.length < 6 || numTry === 10) {
        	break;
        }
        var rand1 = Math.floor(Math.random() * (titleCharSet.length - 3))
        var rand2 = Math.floor(Math.random() * (titleCharSet.length - 3))
        if (rand1 != rand2 && !isContainSeedWord(titleCharSet[rand1]) && !isContainSeedWord(titleCharSet[rand2])) {
            // swap word
            var temp = titleCharSet[rand1]
            titleCharSet[rand1] = titleCharSet[rand2]
            titleCharSet[rand2] = temp
            numSwap++
        } else {
        	numTry++
        }
    }
    return titleCharSet.join(' ').split('/').join('').split('-').join('').split('.').join('').split('*').join('')
   	//return titleCharSet.join(' ').replace('/', '').replace('-', '').replace('.', '').replace('*', '')
}

