function loadDoc(url, cFunction) {
    var xhttp;
    xhttp = new XMLHttpRequest();
    xhttp.onreadystatechange = function() {
        if (this.readyState == 4 && this.status == 200)  {
            cFunction(this, url);
        }
    };
    xhttp.open("GET", url, true);
    xhttp.setRequestHeader('Content-Type', 'text/xml');
    xhttp.send();
}

